import React from 'react';
import { Doughnut  } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);


export default function PieChart() {
    const labels = [
        "January",
        "February",
        "March",
        "April",
        "May",
        "June",
        "July",
      ];
      const scores = [1, 2, 3, 4, 5, 6, 7];
    
      const data = {
        datasets: [
          {
            label: "Mis datos",
            data: scores,
          },
        ],
      };
      return <Doughnut data={data} options={{ responsive: true }} />;
    }
